DROP DATABASE IF EXISTS syrup;
CREATE DATABASE IF NOT EXISTS syrup;
USE syrup;

CREATE TABLE IF NOT EXISTS Accounts (
    id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(12) NOT NULL UNIQUE,
    hash BINARY(16) NOT NULL,
    salt BIGINT UNSIGNED NOT NULL,
    pic VARCHAR(16),
    tos BOOL NOT NULL DEFAULT 0,
    gender BOOL DEFAULT NULL
);

CREATE TABLE IF NOT EXISTS Characters (
    id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(12) NOT NULL UNIQUE,
    account_id INT UNSIGNED NOT NULL,
    world TINYINT UNSIGNED NOT NULL,
    map INT UNSIGNED NOT NULL,
    spawn TINYINT UNSIGNED NOT NULL,
    job SMALLINT UNSIGNED NOT NULL,
    level TINYINT UNSIGNED NOT NULL DEFAULT 1,
    exp INT NOT NULL DEFAULT 0,
    max_hp SMALLINT NOT NULL DEFAULT 50,
    hp SMALLINT NOT NULL DEFAULT 50,
    max_mp SMALLINT NOT NULL DEFAULT 5,
    mp SMALLINT NOT NULL DEFAULT 5,
    str SMALLINT NOT NULL DEFAULT 12,
    dex SMALLINT NOT NULL DEFAULT 5,
    int_ SMALLINT NOT NULL DEFAULT 4,
    luk SMALLINT NOT NULL DEFAULT 4,
    hpmp SMALLINT NOT NULL DEFAULT 0, -- Number of APs that were invested torwards the hp/mp stat
    ap SMALLINT NOT NULL DEFAULT 0,
    sp SMALLINT NOT NULL DEFAULT 0,
    fame SMALLINT NOT NULL DEFAULT 0,
    mesos INT NOT NULL DEFAULT 0,
    gender BOOL NOT NULL,
    skin TINYINT UNSIGNED NOT NULL,
    face INT UNSIGNED NOT NULL,
    hair INT UNSIGNED NOT NULL,
    equip_slots TINYINT UNSIGNED NOT NULL DEFAULT 24,
    use_slots TINYINT UNSIGNED NOT NULL DEFAULT 24,
    setup_slots TINYINT UNSIGNED NOT NULL DEFAULT 24,
    etc_slots TINYINT UNSIGNED NOT NULL DEFAULT 24,
    guild_id BIGINT UNSIGNED DEFAULT NULL,
    guild_rank TINYINT UNSIGNED DEFAULT NULL,
    alliance_rank TINYINT UNSIGNED DEFAULT NULL,
    gm TINYINT UNSIGNED NOT NULL DEFAULT 0,
    INDEX (account_id, world),
    INDEX (guild_id),
    FOREIGN KEY (account_id) REFERENCES Accounts (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS Alliances (
  id BIGINT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
  name VARCHAR(13) NOT NULL UNIQUE,
  capacity INT NOT NULL DEFAULT '2',
  notice VARCHAR(20) DEFAULT NULL,
  rank1 VARCHAR(11) NOT NULL DEFAULT 'Master',
  rank2 VARCHAR(11) NOT NULL DEFAULT 'Jr. Master',
  rank3 VARCHAR(11) NOT NULL DEFAULT 'Member',
  rank4 VARCHAR(11) NOT NULL DEFAULT 'Member',
  rank5 VARCHAR(11) NOT NULL DEFAULT 'Member'
);

CREATE TABLE IF NOT EXISTS Guilds (
    id BIGINT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(45) NOT NULL UNIQUE,
    leader INT UNSIGNED NOT NULL,
    gp INT NOT NULL DEFAULT 0,
    logo INT UNSIGNED DEFAULT NULL,
    logo_color SMALLINT UNSIGNED NOT NULL DEFAULT '0',
    logo_bg INT UNSIGNED DEFAULT NULL,
    logo_bg_color SMALLINT UNSIGNED NOT NULL DEFAULT '0',
    rank1 VARCHAR(45) NOT NULL DEFAULT 'Master',
    rank2 VARCHAR(45) NOT NULL DEFAULT 'Jr. Master',
    rank3 VARCHAR(45) NOT NULL DEFAULT 'Member',
    rank4 VARCHAR(45) NOT NULL DEFAULT 'Member',
    rank5 VARCHAR(45) NOT NULL DEFAULT 'Member',
    capacity INT NOT NULL DEFAULT '10',
    notice VARCHAR(101) DEFAULT NULL,
    signature INT NOT NULL DEFAULT '0',
    alliance_id BIGINT UNSIGNED DEFAULT NULL,
    INDEX (alliance_id),
    FOREIGN KEY (leader) REFERENCES Characters (id),
    FOREIGN KEY (alliance_id)  REFERENCES Alliances (id) ON DELETE SET NULL
);

ALTER TABLE Characters
ADD FOREIGN KEY (guild_id) REFERENCES Guilds (id) ON DELETE SET NULL;

CREATE TABLE IF NOT EXISTS Items (
    id BIGINT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    character_id INT UNSIGNED NOT NULL,
    item_id INT UNSIGNED NOT NULL,
    flags TINYINT NOT NULL DEFAULT 0,
    owner INT UNSIGNED DEFAULT NULL,
    giver INT UNSIGNED DEFAULT NULL,
    deleted BOOL DEFAULT 0,
    INDEX (character_id),
    INDEX (owner),
    INDEX (deleted),
    FOREIGN KEY (character_id) REFERENCES Characters (id) ON DELETE CASCADE,
    FOREIGN KEY (owner) REFERENCES Characters (id) ON DELETE SET NULL,
    FOREIGN KEY (giver) REFERENCES Characters (id) ON DELETE SET NULL
);

CREATE TABLE IF NOT EXISTS InventoryItems (
    item BIGINT UNSIGNED PRIMARY KEY, -- Inventory is determined by the item_id
    slot TINYINT UNSIGNED NOT NULL,
    count INT NOT NULL DEFAULT 1,
    FOREIGN KEY (item) REFERENCES Items (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS Equipment (
    id BIGINT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
    item BIGINT UNSIGNED UNIQUE NOT NULL,
    level TINYINT NOT NULL DEFAULT 0, -- The number of successfully applied scrolls
    slots TINYINT NOT NULL,
    str SMALLINT NOT NULL DEFAULT 0,
    dex SMALLINT NOT NULL DEFAULT 0,
    int_ SMALLINT NOT NULL DEFAULT 0,
    luk SMALLINT NOT NULL DEFAULT 0,
    hp SMALLINT NOT NULL DEFAULT 0,
    mp SMALLINT NOT NULL DEFAULT 0,
    atk SMALLINT NOT NULL DEFAULT 0,
    matk SMALLINT NOT NULL DEFAULT 0,
    def SMALLINT NOT NULL DEFAULT 0,
    mdef SMALLINT NOT NULL DEFAULT 0,
    acc SMALLINT NOT NULL DEFAULT 0,
    avoid SMALLINT NOT NULL DEFAULT 0,
    speed SMALLINT NOT NULL DEFAULT 0,
    jump SMALLINT NOT NULL DEFAULT 0,
    FOREIGN KEY (item) REFERENCES Items (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS InventoryEquipment (
    equip BIGINT UNSIGNED PRIMARY KEY,
    slot TINYINT UNSIGNED NOT NULL,
    FOREIGN KEY (equip) REFERENCES Equipment (id) ON DELETE CASCADE
);

-- The slot of the equipment is determined by its ID
CREATE TABLE IF NOT EXISTS EquippedEquipment (
    equip BIGINT UNSIGNED PRIMARY KEY,
    FOREIGN KEY (equip) REFERENCES Equipment (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS InProgressQuests (
    character_id INT UNSIGNED,
    quest_id SMALLINT UNSIGNED,
    PRIMARY KEY (character_id, quest_id),
    FOREIGN KEY (character_id) REFERENCES Characters (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS Progresses (
    character_id INT UNSIGNED,
    quest_id SMALLINT UNSIGNED,
    progress_id INT UNSIGNED,
    progress SMALLINT NOT NULL,
    PRIMARY KEY (character_id, quest_id, progress_id),
    FOREIGN KEY (character_id, quest_id) REFERENCES InProgressQuests (character_id, quest_id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS QuestInfos (
    character_id INT UNSIGNED,
    info_id SMALLINT UNSIGNED,
    progress VARCHAR(12) NOT NULL,
    PRIMARY KEY (character_id, info_id),
    FOREIGN KEY (character_id) REFERENCES Characters (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS CompletedQuests (
    character_id INT UNSIGNED,
    quest_id SMALLINT UNSIGNED,
    time TIMESTAMP NOT NULL,
    PRIMARY KEY (character_id, quest_id),
    FOREIGN KEY (character_id) REFERENCES Characters (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS Skills (
    character_id INT UNSIGNED,
    skill_id INT UNSIGNED,
    level TINYINT NOT NULL,
    master TINYINT NOT NULL,
    PRIMARY KEY (character_id, skill_id),
    FOREIGN KEY (character_id) REFERENCES Characters (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS Buddies (
    character_id INT UNSIGNED,
    buddy_id INT UNSIGNED,
    PRIMARY KEY (character_id, buddy_id),
    FOREIGN KEY (character_id) REFERENCES Characters (id) ON DELETE CASCADE,
    FOREIGN KEY (buddy_id) REFERENCES Characters (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS MonsterBooks (
    character_id INT UNSIGNED,
    card_id INT UNSIGNED,
    quantity TINYINT NOT NULL,
    PRIMARY KEY (character_id, card_id),
    FOREIGN KEY (character_id) REFERENCES Characters (id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS MonsterItemDrops (
    monster_id INT UNSIGNED,
    item_id INT UNSIGNED,
    chance INT NOT NULL,
    PRIMARY KEY (monster_id, item_id)
);

-- As far as I know, there isn't a quest where the drops are multiple
CREATE TABLE IF NOT EXISTS MonsterQuestItemDrops (
    monster_id INT UNSIGNED,
    item_id INT UNSIGNED,
    quest_id SMALLINT UNSIGNED NOT NULL,
    chance INT NOT NULL,
    PRIMARY KEY (monster_id, item_id, quest_id) -- The same item from the same monster can be used for multiple quests
);

CREATE TABLE IF NOT EXISTS MonsterMesoDrops (
    monster_id INT UNSIGNED,
    min INT NOT NULL DEFAULT 1,
    max INT NOT NULL DEFAULT 1,
    chance INT NOT NULL,
    PRIMARY KEY (monster_id)
);

CREATE TABLE IF NOT EXISTS MonsterMultiItemDrops (
    monster_id INT UNSIGNED,
    item_id INT UNSIGNED,
    min INT NOT NULL DEFAULT 1,
    max INT NOT NULL DEFAULT 1,
    chance INT NOT NULL,
    PRIMARY KEY (monster_id, item_id)
);

CREATE TABLE IF NOT EXISTS temp_drop_data (
    monster_id INT UNSIGNED,
    item_id INT UNSIGNED,
    min INT NOT NULL,
    max INT NOT NULL,
    quest_id SMALLINT UNSIGNED NOT NULL,
    chance INT NOT NULL,
    PRIMARY KEY (monster_id, item_id, quest_id)
);


