DROP TABLE temp_drop_data;

CREATE TABLE IF NOT EXISTS ReactorDrops (
    reactor_id INT UNSIGNED,
    item_id INT UNSIGNED,
    chance INT NOT NULL,
    PRIMARY KEY (reactor_id, item_id)
);

CREATE TABLE IF NOT EXISTS ReactorQuestDrops (
    reactor_id INT UNSIGNED,
    item_id INT UNSIGNED,
    quest_id SMALLINT UNSIGNED NOT NULL,
    chance INT NOT NULL,
    PRIMARY KEY (reactor_id, item_id)
);

CREATE TABLE IF NOT EXISTS ReactorMesoDrops (
    reactor_id INT UNSIGNED,
    min INT NOT NULL DEFAULT 1,
    max INT NOT NULL DEFAULT 1,
    chance INT NOT NULL,
    PRIMARY KEY (reactor_id)
);

CREATE TABLE IF NOT EXISTS temp_reactor_drop_data (
  reactor_drop_id INT UNSIGNED PRIMARY KEY AUTO_INCREMENT,
  reactor_id INT UNSIGNED NOT NULL,
  item_id INT UNSIGNED NOT NULL,
  chance INT NOT NULL,
  quest_id SMALLINT NOT NULL DEFAULT '-1'
);



DROP TABLE temp_reactor_drop_data;

CREATE TABLE IF NOT EXISTS ShopItems (
    shop_id INT UNSIGNED,
    position TINYINT UNSIGNED,
    item_id INT UNSIGNED NOT NULL,
    price INT NOT NULL,
    PRIMARY KEY (shop_id, position)
);

CREATE TABLE IF NOT EXISTS temp_shop_item_data (
    shopitem_id INT UNSIGNED,
    shopid INT UNSIGNED,
    item_id INT UNSIGNED NOT NULL,
    price INT NOT NULL,
    pitch INT NOT NULL,
    position INT UNSIGNED NOT NULL
);



DROP TABLE temp_shop_item_data;

CREATE TABLE IF NOT EXISTS Keymaps (
    character_id INT UNSIGNED,
    `key` INT UNSIGNED,
    type TINYINT UNSIGNED NOT NULL,
    action INT UNSIGNED NOT NULL,
    PRIMARY KEY (character_id, `key`),
    FOREIGN KEY (character_id) REFERENCES Characters (id)
);

